import React from 'react';
import './LandingPage.css';

const LandingPage = () => {
  return (
    <div className="landing-page">
      <div className="hero-section">
        <div style={{
          color: 'black', 
          fontSize: '40px', 
          fontFamily: 'Oxygen Mono', 
          fontWeight: 400, 
          wordWrap: 'break-word',
          display: 'flex',
          alignItems: 'center',
          gap: '8px',
          marginBottom: '8px'
        }}>
          <div style={{width: '32px', height: '32px', position: 'relative', flexShrink: 0}}>
            <div style={{width: '17.35px', height: '0px', left: '16.66px', top: '0px', position: 'absolute', transform: 'rotate(163deg)', transformOrigin: 'top left', outline: '0.50px #ECF4FB solid', outlineOffset: '-0.25px'}}></div>
            <div style={{width: '10.16px', height: '0px', left: '16.50px', top: '0.16px', position: 'absolute', transform: 'rotate(50deg)', transformOrigin: 'top left', outline: '0.50px #A2C5F4 solid', outlineOffset: '-0.25px'}}></div>
            <div style={{width: '23.11px', height: '0px', left: '0.07px', top: '5.10px', position: 'absolute', transform: 'rotate(7deg)', transformOrigin: 'top left', outline: '0.50px #A2C5F4 solid', outlineOffset: '-0.25px'}}></div>
            <div style={{width: '19.24px', height: '0px', left: '22.93px', top: '7.86px', position: 'absolute', transform: 'rotate(128deg)', transformOrigin: 'top left', outline: '0.50px #DDE7F4 solid', outlineOffset: '-0.25px'}}></div>
            <div style={{width: '21px', height: '0px', left: '0px', top: '5.15px', position: 'absolute', transform: 'rotate(58deg)', transformOrigin: 'top left', outline: '0.50px #BCD4F3 solid', outlineOffset: '-0.25px'}}></div>
          </div>
          eigenverse 
        </div>
        <div style={{
          color: 'black', 
          fontSize: '12px', 
          fontFamily: 'Play', 
          fontWeight: 400, 
          wordWrap: 'break-word',
          textAlign: 'center'
        }}>
          Turning scary equations into aha moments.
        </div>
      </div>
    </div>
  );
};

export default LandingPage;
